import React from 'react';

const AboutPage = () => {
  return (
    <div>
      <h1>Giới thiệu</h1>
      <p>Đây là trang giới thiệu về dự án và đội ngũ phát triển.</p>
    </div>
  );
};

export default AboutPage;
